import { Component, EventEmitter, Input, Output } from '@angular/core';

import { SavingService } from '../../savings.service';
import { Saving } from '../../saving.model';

@Component({
    selector: 'app-delete-saving-modal',
    templateUrl: './delete-saving-modal.component.html',
    styleUrls: ['./delete-saving-modal.component.scss']
})
export class DeleteSavingModalComponent {
    @Input() saving!: Saving;
    @Output() remove = new EventEmitter<void>();
    @Output() close = new EventEmitter<void>();

    constructor(private savingService: SavingService) { }

    deleteWithOperations(): void {
        this.savingService.delete({ id: this.saving.id, deleteOperations: true }).subscribe(
            () => this.remove.emit(),
            err => console.error(err.error.message),
            () => this.close.emit()
        );
    }

    delete(): void {
        this.savingService.delete({ id: this.saving.id, deleteOperations: false }).subscribe(
            () => this.remove.emit(),
            err => console.error(err.error.message),
            () => this.close.emit()
        );
    }

    cancel(): void {
        this.close.emit();
    }
}
